import React from 'react';
import { Line } from 'react-chartjs-2';
import {
    Chart as ChartJS,
    LineElement,
    CategoryScale,
    LinearScale,
    PointElement
} from 'chart.js';

ChartJS.register
const Chart = ({ data }) => {
    const options = {
        scales: {
            x: {
                beginAtZero: true,
            },
        },
    };

    return (
        <Line data={data} options={options} />
    );
};

export default Chart;
